option optimize_for = LITE_RUNTIME;

message ProtoProfiler {
    ProtoProfilerTopHeader top_header = 1;
    // Each event is under this added trace
    repeated ProtoTraceMessage added_trace = 2;
}

message ProtoProfilerTopHeader {
    // Relative time, nanosec
    uint64 time_stamp = 1;
    ProtoDateTime time = 2;
    // Hailort version
    string hailort_ver = 3;
    string os_name = 4;
    string os_ver = 5;
    string cpu_arch = 6;
    uint64 sys_ram_size = 7; //bytes
    uint64 time_stamp_since_epoch = 8; //nanosec
    ProtoProfilerPcieInfo pcie_info = 9;
}

message ProtoTraceMessage {
    oneof trace {
        ProtoProfilerSetSchedulerParam core_op_set_value = 1;
        ProtoProfilerAddStreamTrace added_stream = 2;
        ProtoProfilerAddCoreOpTrace added_core_op = 3;
        ProtoProfilerAddDeviceTrace added_device = 4;
        ProtoProfilerActivateCoreOpTrace activate_core_op = 5;
        ProtoProfilerFrameEnqueueTrace frame_enqueue = 6;
        ProtoProfilerFrameDequeueTrace frame_dequeue = 7;
        ProtoProfilerCoreOpSwitchDecision switch_core_op_decision = 8;
        ProtoProfilerDeactivateCoreOpTrace deactivate_core_op = 9;
        ProtoProfilerLoadedHefTrace loaded_hef = 10;
    }
}

message ProtoDateTime {
    uint32 year = 1;
    uint32 month = 2;
    uint32 day = 3;
    uint32 hour = 4;
    uint32 min = 5;
}

message ProtoProfilerDeviceInfo {
    string device_id = 1;
    string device_arch = 2;
}

// The direction of the event, Host-To-Device/Device-To-Host
enum ProtoProfilerStreamDirection {
    PROTO__STREAM_DIRECTION__H2D = 0;
    PROTO__STREAM_DIRECTION__D2H = 1;
}

message ProtoProfilerAddCoreOpTrace {
    uint64 time_stamp = 1; // nanosec
    int32 core_op_handle = 2;
    string core_op_name = 3;
    uint32 max_batch_size = 4;
}

// Frame dequeue means transferring a frame from the buffer to device
// or from the buffer to host
message ProtoProfilerFrameDequeueTrace {
    uint64 time_stamp = 1; // nanosec
    int32 core_op_handle = 2;
    string device_id = 3;
    string stream_name = 4;
    ProtoProfilerStreamDirection direction = 5;
}

// Frame enqueue means transferring a frame from the user to buffer
// or from the device to buffer
message ProtoProfilerFrameEnqueueTrace {
    uint64 time_stamp = 1; // nanosec
    int32 core_op_handle = 2;
    string device_id = 3;
    string stream_name = 4;
    ProtoProfilerStreamDirection direction = 5;
}

// Relevant when using scheduler
message ProtoProfilerCoreOpSwitchDecision {
    uint64 time_stamp = 1; // nanosec
    int32 core_op_handle = 2;
    bool over_threshold = 3;
    bool over_timeout = 4;
    bool switch_because_idle = 5;
}

message ProtoProfilerActivateCoreOpTrace {
    uint64 time_stamp = 1; // nanosec
    int32 new_core_op_handle = 2;
    string device_id = 3;
    double duration = 4; //millisec
    int32 dynamic_batch_size = 5;
}

message ProtoProfilerDeactivateCoreOpTrace {
    uint64 time_stamp = 1; // nanosec
    int32 core_op_handle = 2;
    string device_id = 3;
    double duration = 4; //millisec
}

// Low level streams adding
message ProtoProfilerAddStreamTrace {
    uint64 time_stamp = 1; // nanosec
    int32 core_op_handle = 2;
    string device_id = 3;
    string stream_name = 4;
    int32 queue_size = 5;
    ProtoProfilerStreamDirection direction = 6;
}

// Setting a new params relevant a specific core_op_handle
message ProtoProfilerSetSchedulerParam {
    uint64 time_stamp = 1; // nanosec
    int32 core_op_handle = 2;
    oneof value {
        int64 timeout = 3; // millisec
        int32 threshold = 4;
        int32 priority = 5;
    }
}

message ProtoProfilerAddDeviceTrace {
    uint64 time_stamp = 1; // nanosec
    ProtoProfilerDeviceInfo  device_info = 2;
}

message ProtoProfilerPcieInfo {
    string lanes = 1;
    string  gen = 2;
}

message ProtoProfilerLoadedHefTrace {
    uint64 time_stamp = 1; // nanosec
    string hef_name = 2;
    string dfc_version = 3;
    bytes hef_md5 = 4;
}`,getIndexes=(n,e)=>{const i=[n];for(let f=1;f<e;f++)i.push(i[f-1]+n);return i},getInitialData=(n,e)=>{var q,P;const i={};let f="";const a=n.addedTrace.length,u=getIndexes(Math.round(a/7),7),t=(q=n.addedTrace)==null?void 0:q.reduce((A,N,S)=>{var z,Z,Q,W,X,M,V,k,H,G,K;const D=Object.entries(N),[I]=D,[$,_]=I;if(_){const{timeStamp:U}=_;(typeof A.start>"u"||U<A.start)&&(A.start=U),(typeof A.end>"u"||U>A.end)&&(A.end=U);const j=getDeviceById(A.devices||[],f),T=j?getNetworkById(j.networks,_.coreOpHandle):void 0;if(T&&(T.lastTimeStamp=_.timeStamp),$==="activateCoreOp"){A.switches+=1;const p=getNetworkById((j==null?void 0:j.networks)||[],_.newCoreOpHandle);if(p){p.switches=(p.switches||0)+1,p.activation=(p.activation||0)+_.duration;const v=p.pendingPeriods.length;v&&(p.pendingPeriods[v-1][1]=_.timeStamp),p.loadingPeriods.push([_.timeStamp,void 0,0]),_.dynamicBatchSize!==void 0&&(p.dynamicBatchSizes=[...p.dynamicBatchSizes||[],_.dynamicBatchSize])}}if($==="deactivateCoreOp"){const p=getNetworkById((j==null?void 0:j.networks)||[],_.newCoreOpHandle);p&&(p.deactivation=(p.deactivation||0)+_.duration)}if($==="addedDevice"&&_.deviceInfo!=="undefined"&&(f=_.deviceInfo.deviceId,A.numberOfDevices+=1,A.devices)){const p={};p.id=_.deviceInfo.deviceId,p.arch=((z=_.deviceInfo)==null?void 0:z.deviceArch)||NOT_AVAILABLE,p.pcieGen=(Q=(Z=n==null?void 0:n.topHeader)==null?void 0:Z.pcieInfo)==null?void 0:Q.gen,p.pcieLanes=(X=(W=n==null?void 0:n.topHeader)==null?void 0:W.pcieInfo)==null?void 0:X.lanes,p.startTimeStamp=_.timeStamp,p.networks=[],p.idlePeriods=[],A.devices.push(p)}if($==="loadedHef"&&getDeviceById(A.devices,f)&&(A.lastHefData=_),$==="addedCoreOp"&&_.coreOpName!=="undefined"&&(A.numberOfNetworks+=1,j)){const p={};p.id=_.coreOpHandle,p.label=_.coreOpName,p.details={dfcVersion:{label:"DFC Version",value:((M=A.lastHefData)==null?void 0:M.dfcVersion)||NOT_AVAILABLE},hefIdentifier:{label:"HEF Identifier (MD-5)",value:NOT_AVAILABLE}},p.runningPeriods=[],p.pendingPeriods=[],p.loadingPer
